import React, {useState} from 'react';
import { NavLink } from 'react-router-dom';
// import { AppBar, Toolbar, IconButton, MenuIcon, Typography, Button } from '@material-ui/core';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
// import Button from '@material-ui/core/Button';
// import IconButton from '@material-ui/core/IconButton';
import FormDialog from '../components/dialog.form';
// import MenuIcon from '@material-ui/icons/Menu';

export const Navbar = () => {
  const [cart, setCart] = useState(false);

  const checkCart = () => {
    localStorage.getItem('podarok-print-en') ? setCart(true) : setCart(false);
  }

  return (
    <div>
      <AppBar position="fixed" style={{ 'backgroundColor': 'rgb(22, 22, 22)' }}>
        <Toolbar>
          {/* <IconButton edge="start" className={classes.menuButton} color="inherit" aria-label="menu"> */}
          {/* <MenuIcon /> */}
          {/* </IconButton> */}
          <Typography variant="h6" /*className={classes.title}*/>
            <NavLink to="/" style={{ color: 'white', margin: '0 20px' }}>Logo</NavLink>
            <NavLink to="/cups" style={{ color: "white", margin: '0 20px' }}>Кружки</NavLink>
            <NavLink to="/t-shirts" style={{ color: "white", margin: '0 20px' }}>Футболки</NavLink>
          </Typography>
          {checkCart() ? 
            <Typography variant='h6' style={{ float: 'right', margin: '0 10% 0 65%' }}>
              <FormDialog />
            </Typography>
            : false
          }
        </Toolbar>
      </AppBar>
      <Toolbar />
    </div>
    // <nav>
    // <div className="nav-wrapper blue darken-1" style={{ padding: '0 2rem' }}>
    // {/* <li className="hover hover-3"><NavLink to="/">Logo</NavLink></li> */ }
    // <span className="brand-logo">Logo</span>
    // <ul id="nav-mobile" className="right hide-on-med-and-down">
    // <li className="hover hover-3"><NavLink to="/cups">Кружки</NavLink></li>
    // <li className="hover hover-3"><NavLink to="/t-shirts">Футболки</NavLink></li>
    // <li className="hover hover-3"><NavLink to="/souvenirs">Сувениры</NavLink></li>
    // <li className="hover hover-3"><NavLink to="/create">Конструктор</NavLink></li>
    // </ul>
    // </div>
    // </nav>
  )
}
